  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Malheur Migratory
  Waterfowl Refuge outlines Refuge accomplishments from February through April of
  1942. The report begins by summarizing the weather conditions and water conditions
  during this period. Wildlife- including migratory birds, upland game birds, big
  game animals, furbearers, predators, rodents, and mammals- is also covered. The
  Refuge development and maintenance section discusses physical developments, plantings,
  and collections and receipts. Resource management is outlined; topics include grazing
  and fur harvesting. A progress report on field investigations and applied research
  is also provided. The public relations section of the report describes recreational
  uses, Refuge visitors, and Refuge participation. Items of interest and photographs
  are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
